(16, 'BETA TESTING ROUND 3 AND INTERNAL EXCHANGE TEST  ARE COMING SOON!', '<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">To all EVOAI members,</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Please check out the video of<span style=\"background-color: #ffffff;\"> <a style=\"background-color: #ffffff;\" href=\"https://www.youtube.com/watch?v=fIWCX4BJIwk&amp;t=1527s\">Q&amp;A with our CEO</a></span> Nick that has been uploaded recently!</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">We are happy to announce that our beta testing round 3 and internal exchange test is coming very soon.</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Throughout the testing period, please feel free to tell us the feedbacks in order to provide the fully funtional bot to every single one of our members!</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span id=\"docs-internal-guid-34670227-7fff-b2c2-f40d-53f4e7af3d0c\"><br /><br /></span></p>', 'Customers Announcement', '2019-02-13', '2019-03-31', ',103,875,189,370,962,476,436,369,946,911,985,807,1324,1008,232,576,330,319,1126,812,113