(18, 'Round 3 Beta Testing Will Begin Soon!', '<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">To all EVOAI members,</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">We are happy to announce that our round 3 beta testing will begin soon!</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">The exact time and date will be March 6th 9 AM GMT.</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">You can deposit 2000 tokens on both ETH and Token module EVABOT.</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">If there are any bugs or glitches, please feel free to provide us some feedback!</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p><span id=\"docs-internal-guid-4450e4eb-7fff-2715-2b61-fd1b4dc381e6\"><br /><br /></span></p>', 'Customers Announcement', '2019-03-05', '2019-03-31', ',103,369,1018,364,339,812,905,679,341,1286,352,1058,875,206,41,888,1229,497,710,1008,946,476,293,189,885,1071,1126,554,1141,478,302,943,975,859,807,232,180,907,786,771,576,815,121,887,311,893,127,977,92,93,680,1053,79,1316,1328,1083,230,1344,315,846,1309,985,115,33,1114,1128,307,63,323,814,43,911,330,142,1227,700,78,80,862,322,194,612,319,1117,318,904,1149,956,1264,599,979,282,161,984,202,90,916,1321,216,296,780,809,120,289,1163,332,971,1116,922,312,1348,1349,606,343,1350,221,345,1278,279,1351,135,928,961,1333,1355,215,164,277,1057,1269,842,1361,67,136,721,555,755,1034,691,1024,864,865,1354,158,1138,1189,200,1289,1300,1202,670,994,1036,1075,692,1366,813,436,138,1076,633,272,412,117,1275,902,414,860,891,709,489,403,826,1,810,309,488,784,1224,185,356,522,742,1374,1240,1342,1118,856,1368,1377,1378,457,734,527,1379,654,1381,1384,1002,1352,1271,1388', 1, '2019-03-05 03:21:23', '2019-03-05 03:21:23');
